import React from 'react';
import Stagiaire from './Stagiaire';
import { Link } from 'react-router-dom';

const ListStagiaire = (props) => {
    return (
        <>
            <main className="container"> 
                <h1>List Des Stagiaires </h1> 
                 <Link to="/StagiaireAjouter"> <button type='button'> Ajouter Stagiaire</button></Link>
                <div className="row mb-2">
                {
                     props.listStg.map((e)=>
                        
                            <div >
                             <img src={e.img1}/>
                                <h5>Le titre : {e.titre1}</h5>
                                <p> le prix : {e.price1} DH</p>
                           </div>
                )}
                </div> 
            </main> 
        </>
    );
}

export default ListStagiaire;
